__NUXT_JSONP__("/drugs/MEK_Inhibitor_TAK-733", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An orally bioavailable small-molecule inhibitor of MEK1 and MEK2 (MEK1\u002F2) with potential antineoplastic activity. MEK inhibitor TAK-733 selectively binds to and inhibits the activity of MEK1\u002F2, preventing the activation of MEK1\u002F2-dependent effector proteins and transcription factors, which may result in the inhibition of growth factor-mediated cell signaling and tumor cell proliferation. MEK1\u002F2 (MAP2K1\u002FK2) are dual-specificity threonine\u002Ftyrosine kinases that play key roles in the activation of the RAS\u002FRAF\u002FMEK\u002FERK pathway and are often upregulated in a variety of tumor cell types.",fdaUniiCode:"5J61HSP0QJ",identifier:"C84858",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C69145"],synonyms:[c,"TAK-733"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMEK_Inhibitor_TAK-733",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","MEK_Inhibitor_TAK-733","MEK Inhibitor TAK-733","2021-10-30T13:46:17.823Z")));